import React from "react";

import Paper from "@mui/material/Paper";

import ListItemText from "@mui/material/ListItemText";

// import List from '@mui/material/List';
import ListItem from "@mui/material/ListItem";
import Link from "@mui/material/Link";
import { gridSpacing } from "store/constant";

import { Divider, Grid, Typography, Button } from "@mui/material";

// project imports
import SubCard from "ui-component/cards/SubCard";
import Accordion from "ui-component/extended/Accordion";
import MainCard from "ui-component/cards/MainCard";
import SecondaryAction from "ui-component/cards/CardSecondaryAction";

// assets
import ArrowDropDownIcon from "@mui/icons-material/ArrowDropDown";
import FaceTwoToneIcon from "@mui/icons-material/FaceTwoTone";
import DomainTwoToneIcon from "@mui/icons-material/DomainTwoTone";
import FastfoodIcon from "@mui/icons-material/Fastfood";
import AccessTimeIcon from "@mui/icons-material/AccessTime";
import AltRouteIcon from "@mui/icons-material/AltRoute";
import HelpIcon from "@mui/icons-material/Help";
import Center from "react-center";
import Swal from "sweetalert2";

const request = () => {

	Swal.fire({
	  icon: 'success',
	title: 'Gracias',
	text: 'Tu requerimiento ha sido Recibido!',
	footer: 'Un Agente se pondrá en contacto a la brevedad'
	})
  } 

export default function FdaRegister() {
  return (
    <div>
      {" "}
      <Grid container spacing={gridSpacing}>
        <Grid item xs={12} sm={6}>
          <SubCard title="Ecommerce Logistics lo apoya con FSVP para Sellers (Small Foreing Import of Records)">
            <Typography variant="body2" sx={{ textAlign: "justify" }}>
              Necesitará un agente del FSVP si es un vendedor de Amazon que
              exporta productos alimenticios/bebidas o suplementos dietéticos a
              los Estados Unidos. Tras varias alarmas sanitarias relacionados
              con productos importados, la FDA está tomando medidas enérgicas
              contra el Programa de Verificación de Proveedores Extranjeros. Si
              se descubre que incumple la normativa más reciente de la FDA, el
              Reglamento de Controles Preventivos para Alimentos Humanos y
              Animales de la FSMA y la Regla de Seguridad de Productos de la
              FSMA, se puede prohibir la entrada de su producto en Estados
              Unidos, lo que podría ser desastroso para su empresa. La Ley de
              Modernización de la Seguridad Alimentaria (FSMA) ha dado la vuelta
              a las normas de aplicación de la seguridad alimentaria para los
              vendedores de alimentos de Amazon. Según lo declarado por la FDA :
              "Todos los productos regulados por la FDA que se importan a los
              Estados Unidos deben cumplir las mismas leyes y regulaciones que
              los productos nacionales. Los alimentos importados deben ser
              puros, saludables, seguros de consumir y producidos en condiciones
              sanitarias, y deben contener un etiquetado informativo y veraz en
              inglés".
            </Typography>
            <Center>
              <Button onClick={request} variant="contained">
                Solicitar Servicio
              </Button>
            </Center>
          </SubCard>
        </Grid>
      </Grid>
    </div>
  );
}
